import React, { useEffect, useState } from 'react'

const ProductList = () => {
    const [products, setProducts] = useState([]);

    useEffect(() => {
        getProducts();
    }, []);

    const getProducts = async () => {
        let result = await fetch("http://localhost:5000/products");
        result = await result.json();
        setProducts(result);
    }
    console.warn("products", products);


    return (
        <div className="vh-100 m-20 ">
            <div className="mask d-flex align-items-center h-100 gradient-custom-3">
                            <div class="card  border rounded-lg border-info" >
                <div className="container h-95">

                        <div class="col-12 col-md-9 col-lg-7 col-xl-6">
                        <div class="list-group"></div>
                                <ul class="list-group list-group-horizontal-md">
                                    <li class="list-group-item">S. No</li>
                                    <li class="list-group-item">Name</li>
                                    <li class="list-group-item">Prise</li>
                                    <li class="list-group-item">Category</li>
                                    <li class="list-group-item">Company</li>
                                </ul>
                                {products.map((item, index) =>
                                    <ul class="list-group list-group-horizontal-md">
                                        <li class="list-group-item">{index + 1}</li>
                                        <li class="list-group-item">{item.name}</li>
                                        <li class="list-group-item">{item.price}</li>
                                        <li class="list-group-item">{item.category}</li>
                                        <li class="list-group-item">{item.company}</li>
                                    </ul>)}
                            </div>
                        </div>

                    </div>
                </div>
            </div>

            )
}

            export default ProductList;
